subproject.description:
(I) Set of recommendations to establish the investment promotion and facilitation capacity in 3 selected provinces;
(II) A set of recommendations to develop guidelines and procedure better to integrate the Private Sector in the provincial planning (in order to support public servides delivery);
(III) A set of recommendations to incorperate a formal public private consultative mechanism (Provincial Public and Private Dialogue-PPPD) into the D & D reform process.
